import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <div className="foot">
        <span className="foot-name">KinoLux</span>
        <ul className="foot-list">
          <li className="foot-item">Facebook</li>
          <li className="foot-item">Facebook</li>
          <li className="foot-item">Facebook</li>
          <li className="foot-item">Facebook</li>
          <li className="foot-item">Facebook</li>
          <i class="fa-brands fa-facebook-f"></i>
        </ul>
      </div>
    </footer>
  );
}

export default Footer;
